import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
// import Team from '../Team';
import About from '../About';
import Whyus from '../Whyus';
import Partner from '../Partner';
import Footer from '../Footer';
import Ourstats from '../Ourstats';
import Announcement from "react-popup-announcement";


function Home() {
  return (
    <>
       <Announcement
        title="SSA ICEBREAKER 2022"
        subtitle="Come meet other Singaporeans, learn about Singaporean culture, and have a great time!"
        imageSource='images/ice21yuh.jpg'
        daysToLive={0}
        secondsBeforeBannerShows={0}
        buttonText="Register :D!"
        closeIconSize={30}
        animateOutDuration={500}
      />
      <Announcement
        title="Here is your component"
        subtitle="The best announcement component for React is finally here. Install it in all your projects."
        link="https://github.com/kristofferandreasen/react-popup-announcement"
        imageSource={Image}
        buttonText="Click here!"
      />
      <HeroSection />
      <About />
      <Whyus />
      <Ourstats />
      <Cards />
      {/* <Team /> */}
      <Partner />
      <Footer />
    </>
  );
}

export default Home;
